    P_Ins_SUBHOP.ID_T_SUBHOP := v_id_subhop;
    P_Ins_SUBHOP.Cod_Trt := 'ORA-00000 : Normal, Successful completion';
    COMMIT;
 EXCEPTION
   WHEN OTHERS THEN
    P_Ins_SUBHOP.Cod_Trt := SUBSTR(SQLERRM,1,255);
